import React from "react";
//pdf package
import file from "../images/resume.pdf";
//styleing
import "../Style/main.css";

const Resume = (props) => {
  return (
    <div>
      <div className="lg:block hidden">
        <embed src={file} type="application/pdf" width="100%" height="1000px" />
      </div>
      <div className="lg:hidden block">
        <div className="rounded mr-auto">
          <div className="bg-blue-600 inline-block rounded py-1 px-3 hover:bg-blue-900">
            <svg
              className="w-6 h-6"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                stroke="white"
                d="M7 21h10a2 2 0 002-2V9.414a1 1 0 00-.293-.707l-5.414-5.414A1 1 0 0012.586 3H7a2 2 0 00-2 2v14a2 2 0 002 2z"
              />
            </svg>
            <a className="text-sm  text-white" href={file}>
              Download Resume
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Resume;
